/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`localhost`*/ /*!50003 PROCEDURE `sp_consulta_alocacao_sala_carteira`(
in cod_concurso int
/*out DESCRICAO_LOCAL_PROVA varchar(100),
out COD_SALA_CONCURSO int,
out	NUMERO_SALA int,
out	CADEIRAS int,
out	MAXIMA_CARTEIRA int,
out	PROXIMA_CARTEIRA int*/
)
begin
    
   SELECT
    A.DESCRICAO_LOCAL,
    A.COD_SALA_CONCURSO,
		A.NUMERO_SALA,
		A.CADEIRAS,
		B.MAXIMA_CARTEIRA,
		IFNULL(B.MAXIMA_CARTEIRA + 1,1) AS PROXIMA_CARTEIRA
        /*INTO
        
        DESCRICAO_LOCAL_PROVA,
        COD_SALA_CONCURSO,
        NUMERO_SALA,
        CADEIRAS,
        MAXIMA_CARTEIRA,
        PROXIMA_CARTEIRA*/
        
 from
    (
    		SELECT
			B.COD_SALA_CONCURSO,
			A.NUMERO_SALA,
			A.CADEIRAS,
			C.DESCRICAO_LOCAL,
			C.COD_LOCAL
		
		FROM 
			TB_SALA_LOCAL A,
			TB_SALA_CONCURSO B,
			TB_LOCAL_PROVA C
		
		WHERE A.COD_SALA_LOCAL=B.COD_SALA AND
		      B.COD_CONCURSO=COD_CONCURSO AND A.COD_LOCAL_PROVA = C.COD_LOCAL
    
    
    )AS A
    
    
	LEFT JOIN
	(
		SELECT
			A.COD_SALA_CONCURSO,
			MAX(A.NUMERO_CARTEIRA) MAXIMA_CARTEIRA
		
		FROM
			TB_CARTEIRA A,
			TB_SALA_CONCURSO B,
			TB_SALA_LOCAL C
		
		WHERE B.COD_SALA_CONCURSO = A.COD_SALA_CONCURSO AND
		      B.COD_SALA=C.COD_SALA_LOCAL
		      AND B.COD_CONCURSO=COD_CONCURSO
		GROUP BY A.COD_SALA_CONCURSO 
	) AS B
	  ON A.COD_SALA_CONCURSO=B.COD_SALA_CONCURSO
	
	
	WHERE (CADEIRAS-IFNULL(B.MAXIMA_CARTEIRA + 1,1))>=0
	ORDER BY A.COD_LOCAL,A.COD_SALA_CONCURSO limit 1;
    






end */;;
